window.bookSummaryJSON = "<p><b>The pressure of being Earth's champion builds....</b></p> <p>As Nicholas Winterhome builds his own city in the wilderness, he strives to make sense of a world full of foreign powers. His strength in battle might not be enough.</p> <p>It'll take wits and determination to survive; and if he wants to sleep at night, he'll need someone he can trust to watch his back. It's time to find some allies.</p> <p><b>Book two in an action-packed LitRPG apocalypse series from the invader's perspective. A monster evolution story with elements of cultivation, base-building, ally-recruitment, a detailed system, power progression, and all the things listeners of LitRPG have come to love.</b></p>"; 
